import {makeStyles} from '@material-ui/core/styles';


export default makeStyles(() => ({
    appBar: {
        backgroundColor: '#057786',
        marginTop: '25px',
        height: '70px',
        alignItems: 'center',
        justifyContent: 'center'
    },
    headerText: {
        justifyContent: 'center',
        fontFamily: 'Noto Serif',
        fontSize: '72px',
        fontStyle: 'normal',
        fontWeight: '600',
        lineHeight: '87px',
        letterSpacing: '0em',
        background: "-webkit-linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)",
        WebkitBackgroundClip: "text",
        WebkitTextFillColor: "transparent"


        // backgroudImage: {
        //     linearGradient: '(90deg, blue, red)',
        //     backgroundClip: 'text',
        //     color: 'transparent'
        // }
    },

    
    //button needed BTW! Do something about it soon
   carousel: {
       marginTop: '100px'
   }
    
    
}))
